function Board(r,t){var i,a;this.init=function(r,t){i=$(r),a=new Array(t);for(var n=0;n<t;n++)a[n]=new Array(t);return this},this.display=function(){i.empty();for(var r=0;r<a.length;r++){for(var t="<tr>",n=0;n<a[r].length;n++)t+='<td class="square" id="'+n+"-"+r+'"></td>';t+="</tr>",i.append(t)}},this.init(r,t)}